import React from "react";

import { signInWithGoogle } from "../../firebase/firebase.utils";

class SignIn extends React.Component {
  constructor() {
    super();

    this.state = {
      email: "",
      password: "",
    };
  }

  render() {
    return (
      <div>
        <button onClick={signInWithGoogle}></button>
      </div>
    );
  }
}

export default SignIn;
